<?php

namespace Database\Seeders;

// use Illuminate\Database\Console\Seeds\WithoutModelEvents;
use App\Models\Category;
use App\Models\Course;
use App\Models\Enrollment;
use App\Models\Level;
use App\Models\Review;
use App\Models\User;
use Illuminate\Database\Seeder;
use Illuminate\Support\Facades\Hash;

class DatabaseSeeder extends Seeder
{
    /**
     * Seed the application's database.
     *
     * @return void
     */
    public function run()
    {
        $admin = User::factory()->create([
            'email' => 'admin@admin.com',
            'password' => Hash::make('password')
        ]);

        $categories = [
            'laravel'    => Category::factory()->create(['name' => 'laravel', 'image_url' => 'data:image/png;base64,']),
            'php'        => Category::factory()->create(['name' => 'php', 'image_url' => 'data:image/png;base64,']),
            'symfony'    => Category::factory()->create(['name' => 'symfony', 'image_url' => 'data:image/png;base64,']),
            'javascript' => Category::factory()->create(['name' => 'javascript', 'image_url' => 'data:image/png;base64,']),
            'python'     => Category::factory()->create(['name' => 'python', 'image_url' => 'data:image/jpeg;base64,']),
            'ruby'       => Category::factory()->create(['name' => 'ruby', 'image_url' => 'data:image/jpeg;base64,']),
            'rust'       => Category::factory()->create(['name' => 'rust', 'image_url' => 'data:image/png;base64,']),
            'react'      => Category::factory()->create(['name' => 'react', 'image_url' => 'data:image/png;base64,']),
        ];

        Level::factory()->create(['name' => 'All Levels']);
        Level::factory()->create(['name' => 'Beginner']);
        Level::factory()->create(['name' => 'Intermediate']);
        Level::factory()->create(['name' => 'Expert']);

        Course::factory(10)->create(['category_id' => $categories['laravel']->id]);
        Course::factory(10)->create(['category_id' => $categories['php']->id]);
        Course::factory(10)->create(['category_id' => $categories['symfony']->id]);
        Course::factory(10)->create(['category_id' => $categories['javascript']->id]);
        Course::factory(10)->create(['category_id' => $categories['python']->id]);
        Course::factory(10)->create(['category_id' => $categories['ruby']->id]);
        Course::factory(10)->create(['category_id' => $categories['rust']->id]);
        Course::factory(10)->create(['category_id' => $categories['react']->id]);

        User::factory(7)->create();

        Course::all()->collect()->each(function ($item) {
            for ($x = 1; $x <= 7; $x++)
            {
                Review::factory()->create([
                    'course_id' => $item,
                    'user_id' => (int) $x
                ]);
            }

            Enrollment::factory(rand(1,30))->create([
                'course_id' => $item
            ]);
        });
    }

    public function old()
    {
        $category = Category::factory(10)->create()->first();

        Level::factory()->create(['name' => 'All Levels']);
        Level::factory()->create(['name' => 'Beginner']);
        Level::factory()->create(['name' => 'Intermediate']);
        Level::factory()->create(['name' => 'Expert']);

        Course::factory(10)->create(['category_id' => $category->id]);

        for ($i = 1; $i <= 10; $i++) {
            Review::factory(3)->create([
                'course_id' => $i
            ]);
        }
        for ($courses = 1; $courses <= 30; $courses++) {
            Enrollment::factory(rand(1,30))->create([
                'course_id' => $courses
            ]);
        }
    }
}
